def weak_pwd(host:str,data:list):
    port = host.split(':')[1]
    if str(port) == '443':
        url="https://{}/api/auth/login".format(host)
    else:
        url = "http://{}/api/auth/login".format(host)
    try:
        for i in data:
            resp = requests.post(url=url, json=i, verify=False,timeout=5)
            if resp.status_code == 200:
                print('success {}'.format(host))
                return i['username'] , i['password']
            if resp.status_code == 401:
                #print('bad pwd')
                continue
            else:
                return False,False
    except requests.exceptions.Timeout as e:
        return False,False
    except Exception as e:
        print(e)
        return False,False

    return False, False

